import React from "react";
import { StyledTextField, StyledSelect, StyledMenuItem } from "../styles/formStyles";

// üîπ –î–∞–Ω–Ω—ã–µ –¥–ª—è –≤—ã–ø–∞–¥–∞—é—â–∏—Ö —Å–ø–∏—Å–∫–æ–≤
const propertyTypes = ["–ö–≤–∞—Ä—Ç–∏—Ä–∞", "–î–æ–º", "–ö–æ—Ç—Ç–µ–¥–∂", "–ö–æ–º–Ω–∞—Ç–∞", "–ê–ø–∞—Ä—Ç–∞–º–µ–Ω—Ç—ã"];
const carBrands = ["Toyota", "BMW", "Mercedes", "Audi", "Ford"];
const serviceTypes = ["–†–µ–º–æ–Ω—Ç", "–£–±–æ—Ä–∫–∞", "–î–æ—Å—Ç–∞–≤–∫–∞", "–†–µ–ø–µ—Ç–∏—Ç–æ—Ä—Å—Ç–≤–æ", "–ö—É—Ä—å–µ—Ä"];

export const FormFields = ({ formData, handleChange }) => {
  return (
    <>
      <StyledTextField label="–ù–∞–∑–≤–∞–Ω–∏–µ" name="name" value={formData.name} onChange={handleChange} required />
      <StyledTextField label="–û–ø–∏—Å–∞–Ω–∏–µ" name="description" value={formData.description} onChange={handleChange} multiline rows={3} required />
      <StyledTextField label="–õ–æ–∫–∞—Ü–∏—è" name="location" value={formData.location} onChange={handleChange} required />

      {/* üîπ –ö–∞—Ç–µ–≥–æ—Ä–∏—è –æ–±—ä—è–≤–ª–µ–Ω–∏—è */}
      <StyledSelect name="type" value={formData.type} onChange={handleChange} displayEmpty required>
        <StyledMenuItem value="" disabled>–ö–∞—Ç–µ–≥–æ—Ä–∏—è</StyledMenuItem>
        <StyledMenuItem value="–ù–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç—å">–ù–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç—å</StyledMenuItem>
        <StyledMenuItem value="–ê–≤—Ç–æ">–ê–≤—Ç–æ</StyledMenuItem>
        <StyledMenuItem value="–£—Å–ª—É–≥–∏">–£—Å–ª—É–≥–∏</StyledMenuItem>
      </StyledSelect>

      {/* üîπ –ü–æ–ª—è –¥–ª—è –Ω–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç–∏ */}
      {formData.type === "–ù–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç—å" && (
        <>
          <StyledSelect name="propertyType" value={formData.propertyType} onChange={handleChange} displayEmpty required>
            <StyledMenuItem value="" disabled>–¢–∏–ø –Ω–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç–∏</StyledMenuItem>
            {propertyTypes.map((type) => (
              <StyledMenuItem key={type} value={type}>{type}</StyledMenuItem>
            ))}
          </StyledSelect>
          <StyledTextField label="–ü–ª–æ—â–∞–¥—å (–º¬≤)" name="area" type="number" value={formData.area} onChange={handleChange} required />
          <StyledTextField label="–ö–æ–ª–∏—á–µ—Å—Ç–≤–æ –∫–æ–º–Ω–∞—Ç" name="rooms" type="number" value={formData.rooms} onChange={handleChange} required />
          <StyledTextField label="–¶–µ–Ω–∞ (‚ÇΩ)" name="price" type="number" value={formData.price} onChange={handleChange} required />
        </>
      )}

      {/* üîπ –ü–æ–ª—è –¥–ª—è –∞–≤—Ç–æ */}
      {formData.type === "–ê–≤—Ç–æ" && (
        <>
          <StyledSelect name="brand" value={formData.brand} onChange={handleChange} displayEmpty required>
            <StyledMenuItem value="" disabled>–ú–∞—Ä–∫–∞</StyledMenuItem>
            {carBrands.map((brand) => (
              <StyledMenuItem key={brand} value={brand}>{brand}</StyledMenuItem>
            ))}
          </StyledSelect>
          <StyledTextField label="–ú–æ–¥–µ–ª—å" name="model" value={formData.model} onChange={handleChange} required />
          <StyledTextField label="–ì–æ–¥ –≤—ã–ø—É—Å–∫–∞" name="year" type="number" value={formData.year} onChange={handleChange} required />
          <StyledTextField label="–ü—Ä–æ–±–µ–≥ (–∫–º)" name="mileage" type="number" value={formData.mileage} onChange={handleChange} />
        </>
      )}

      {/* üîπ –ü–æ–ª—è –¥–ª—è —É—Å–ª—É–≥ */}
      {formData.type === "–£—Å–ª—É–≥–∏" && (
        <>
          <StyledSelect name="serviceType" value={formData.serviceType} onChange={handleChange} displayEmpty required>
            <StyledMenuItem value="" disabled>–¢–∏–ø —É—Å–ª—É–≥–∏</StyledMenuItem>
            {serviceTypes.map((service) => (
              <StyledMenuItem key={service} value={service}>{service}</StyledMenuItem>
            ))}
